import './Sidebar.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faTachometerAlt, faUsers, faBox, faCog } from '@fortawesome/free-solid-svg-icons';
import React from 'react';
import { Link } from 'react-router-dom';

const Sidebar = () => {
  return (
    <div className="sidebar">
      <ul>
        <li>
          <Link to="/doctor" className="nav-button active">
            <FontAwesomeIcon icon={faTachometerAlt} className="nav-icon" />
            Doctor
          </Link>
        </li>
        <li>
          <Link to="/patients" className="nav-button">
            <FontAwesomeIcon icon={faUsers} className="nav-icon" />
            Patients
          </Link>
        </li>
        <li>
          <Link to="/appointments" className="nav-button">
            <FontAwesomeIcon icon={faBox} className="nav-icon" />
            Appointments
          </Link>
        </li>
        <li>
          <Link to="/settings" className="nav-button">
            <FontAwesomeIcon icon={faCog} className="nav-icon" />
            Settings
          </Link>
        </li>
        {/* Add more menu items as needed */}
      </ul>
    </div>
  );
};

export default Sidebar;
